import { useEffect, useState } from 'react';
import { Formik } from 'formik';

import "./Login.css"


function useFormik({
    initialValues 
}) {
    const [values, setValues] = useState(initialValues);


    function handleChange(event){
        console.log("alguem diditou");
        setValues({
        userEmail:'oi',
        userPassword: '123',
        }) 
    }

    return {
        values, 
        handleChange
    }
}

function Login(){
    const formik = useFormik({
      initialValues:{
        userEmail: 'email@gmail.com',
        userPassword: '123456',
    } 

    })

    return(

        <div className='cadastro'>

       <div className="tab-container"> 

        <div className="login-usuario">
        <img className= "image" src="https://www.vittude.com/static/images/psico-orange.svg" alt=""></img>
        <span class="active">Psic√≥logo</span>
        </div>

       <div className="login-usuario">
       <img className= "image" src="https://www.vittude.com/static/images/paciente-terracota.svg" alt=""></img>
       <span class="active">Paciente</span>
       </div>

       </div>
        <form className="form" action="/login" method="POST">

            <div className="formField">
                <label htmlFor="userEmail">Seu email</label>
                <input className="input_cadastro" 
                type="email" 
                placeholder="Digite seu email..." 
                name="userEmail" 
                id="userEmail"
                value={formik.values.userEmail}
                />


            </div>
            <div className="formField">
                <label htmlFor="userPassword">Sua senha</label>
                <input className="input_cadastro" 
                type="password" 
                placeholder="Digite sua senha..."
                name="userPassword" 
                id="userPassword"
                onChange={formik.handleChange}
                value={formik.values.userPassword} />
            </div>

            <div className="enviar-cadastro">
            <div class="link-login">
                 <a href="/cadastro">Esqueci minha senha</a>
                </div>
                <button className="button" type="submit">Entrar</button>

            </div>

        </form>
    </div>

    )
}

export default Login;
